import React from "react";
import Navbar from "./navmenu/Navbar";
import Contact from "./Contact";
import { useTheme } from "@material-ui/core/styles";
import { withStyles } from "@material-ui/core/styles";
import animalImg from "../img/animal.jpg";
import angryCatImg from "../img/angrycat.jpg";

import { Box, Button, Typography, Avatar } from "@material-ui/core";

const styles = (theme) => ({});

const BlogListEntry = (props) => {
  const { classes } = props;

  //   const classes = useStyles();
  const theme = useTheme();
  return (
    <>
      <Box>
        <Box
          style={{
            display: "flex",
            justifyContent: "space-between",
            border: "2px white solid",
            minHeight: "100px",
          }}
        >
          <Avatar
            alt="Remy Sharp"
            src={animalImg}
            style={{
              // flexBasis: "14%;",
              height: "auto",

              border: `.3rem ${theme.palette.accent1.main} solid`,
              border: "2px white solid",
            }}
          ></Avatar>
          <Typography
            variant="body1"
            style={{ flexBasis: "82%", border: "2px white solid" }}
          >
            these are my blogs
          </Typography>
        </Box>
      </Box>

      <section id="bloglist" class="middle container">
        {/* <h1></h1> */}
        <h2 class="thinsubtitle">let's see how this goes</h2>

        <div class="bloglisting">
          <div class="blogimg">
            <img src={angryCatImg} />
          </div>
          <div class="blogcontent">
            <h3>
              <a href="blogEntry2.html">fan of cats</a>
            </h3>
            <p>i'm a fan of cats</p>
          </div>
        </div>
      </section>
    </>
  );
};

export default withStyles(styles)(BlogListEntry);
